import React, {Component} from 'react';


export default class Scan extends Component {

    constructor() {
        super();

        this.state = {
            hasMedia: false
        };
    }

    render() {
        
        return (
            <div className="video-container">
                <video className="video" ref={(ref) => {this.myVideo = ref;}}></video>
            </div>

        )
    }



}
